import React from "react";
import PropTypes from "prop-types";
import { withStyles } from "material-ui/styles";
import AppBar from "material-ui/AppBar";
// import Tabs, { Tab } from "material-ui/Tabs";
// import Typography from "material-ui/Typography";
// import Grid from "material-ui/Grid";
// import TextField from "material-ui/TextField";
// import Menu, { MenuItem } from "material-ui/Menu";
// App
//import theme from './theme';

function TabContainer(props) {
  return (
    <Typography type="body1" component="div">
      {props.children}
    </Typography>
  );
}

TabContainer.propTypes = {
  children: PropTypes.node.isRequired
};

const styles = theme => ({
  root: {
    flexGrow: 1,
    fontSize: "12px"
  },
  logo: {
    height: "45px"
  },
  navbar: {
    margin: "0",
    height: "45px",
    minHeight: "45px"
  },
  toolbar: {
    height: "45px",
    minHeight: "45px"
  },
  dropdown: {
    top: "37px"
  },
  griditem: {
    padding: "5px",
    margin: "0",
    position: "relative"
  },
  search: {
    position: "absolute",
    right: "0",
    fontSize: "0.87rem",
    borderBottom: "0.25px solid #FF1744"
  },
  tabs: {
    minHeight: "48px"
  },
  tab: {
    height: "48px",
    textTransform: "none",
    minWidth: "0"
  },
  selectedTab: {
    backgroundColor: "#000"
  },
  textFieldInput: {
    fontSize: "12px"
  },
  menuItem: {
    fontSize: "12px"
  },
  searchlabel: {
    fontSize: "0.87rem",
    color: "rgba(0, 0, 0, 0.54)",
    top: "-4px"
  },
  tabactive: {
    backgroundColor: "rgba(0, 0, 0, 0.12)"
  },
  dropDownMenuItem: {
    fontSize: "0.87rem"
  },
  inkbar: {
    color: "red"
  },
  labeldense: {
    transform: "translate(0, 17px) scale(1)"
  }
});

class BasicTabs extends React.Component {
  state = {
    anchorEl: null,
    open: false,
    value: 0
  };

  handleChange = (event, value) => {
    this.setState({ value });
  };

  handleClick = event => {
    this.setState({ open: true, anchorEl: event.currentTarget });
  };

  handleClose = () => {
    this.setState({ open: false });
  };

  render() {
    const { classes } = this.props;
    const { value } = this.state;
    const { value2 } = this.state;

    return (
      <div className={classes.root}>
        <AppBar className={classes.navbar} color="default" position="static">
          <Grid justify="center" container>
            <Grid className={classes.griditem} item xs={2} sm={1}>
              <img
                className={classes.logo}
                alt="logo"
                src="http://static.mts.ru/uploadmsk/contents/1655/MTS_logo_color_ru.png"
              />
            </Grid>
            <Grid className={classes.griditem} item xs md={8}>
              <Tabs value={value} onChange={this.handleChange}>
                <Tab
                  classes={{ rootInheritSelected: classes.tabactive }}
                  className={classes.tab}
                  label="Link 1"
                />
                <Tab
                  classes={{ rootInheritSelected: classes.tabactive }}
                  className={classes.tab}
                  label="Link 2"
                />
                <Tab
                  classes={{ rootInheritSelected: classes.tabactive }}
                  className={classes.tab}
                  aria-owns={this.state.open ? "nav-bar" : null}
                  aria-haspopup="true"
                  onClick={this.handleClick}
                  label="Link 3"
                />
                <Menu
                  id="nav-bar"
                  anchorEl={this.state.anchorEl}
                  open={this.state.open}
                  onClose={this.handleClose}
                  className={classes.dropdown}
                >
                  <Grid container>
                    <Grid sm={6}>
                    <Typography type="heading">
                    Otra cosa
                    </Typography>
                      <Typography type="body1">
                        Otra cosa 2
                      </Typography>
                    </Grid>
                    <Grid sm={6}>
                      <MenuItem
                        className={classes.dropDownMenuItem}
                        onClick={this.handleClose}
                      >
                        holi 1
                      </MenuItem>
                      <MenuItem
                        className={classes.dropDownMenuItem}
                        onClick={this.handleClose}
                      >
                        Holi 2
                      </MenuItem>
                      <MenuItem
                        className={classes.dropDownMenuItem}
                        onClick={this.handleClose}
                      >
                        holi 3
                      </MenuItem>
                    </Grid>
                  </Grid>
                </Menu>
              </Tabs>
            </Grid>
            <Grid className={classes.griditem} item xs>
              <TextField
                error
                id="search"
                label="que paso"
                type="search"
                margin="none"
                className={classes.search}
                classes={{
                  inkbar: classes.inkbar,
                  labelDense: classes.labeldense
                }}
                labelClassName={classes.searchlabel}
              />
            </Grid>
            <Grid className={classes.griditem} item xs={1}>
              <Tabs className={classes.tabs} value={value2}>
                <Tab
                  classes={{ rootInheritSelected: classes.tabactive }}
                  className={classes.tab}
                  label="aqui estoy"
                />
              </Tabs>
            </Grid>
          </Grid>
        </AppBar>
        {value === 0 && <TabContainer />}
        {value === 1 && <TabContainer />}
        {value === 2 && <TabContainer />}
        {value2 === 3 && <TabContainer />}
      </div>
    );
  }
}

BasicTabs.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(BasicTabs);
